import React from 'react';
import Layout from './MainLayout';

const NotFound = () => {
    
    const center = {
        textAlign: 'center'
    }

    return ( 
        <Layout>
            <div style={center}>
                <h1>404</h1>
                <p>This is the 404 Page.</p>
            </div>
        </Layout>
     );
}
 
export default NotFound;
